import { useSelector,useDispatcher } from 'react-redux'
// import App from '../App';
// import data from '../groceries/data';
export default function Home() {
    let state=useSelector(state=>state.count)
    let dispatch=useDispatcher()

    // console.log(state);
    let allGroceries=state
    return (
        <div className="name">
            <div>hey</div>
           <div>
               {allGroceries.map((obj)=>{
                   return(
                       <div>
                           {obj.title}
                       </div>
                       )
               })}
           </div>

        </div>
    )
}
